const block0 = (context, tags, suffix) => html`<div class="ui5-page-root"><header class="ui5-page-header-root" id="ui5-page-header"><slot name="header"></slot></header><section class="ui5-page-content-root" style="${styleMap(context.styles.content)}"><slot></slot></section><footer class="ui5-page-footer-root" style="${styleMap(context.styles.footer)}"><slot name="footer"></slot></footer></div>`;


export default block0;
